      SELECT DISTINCT - 60 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + CAST ( NULL AS INTEGER ) = col2 * col2 OR NOT NULL IS NOT NULL;
  - name: tab1

outputs:
  - name: q7624.out
    data: |
      -60
